	 ('543063f4-39e5-4192-948c-c04d5347a83b','7f69ba63-9a55-4cd0-a8ff-c7fff47010f5','Cachoeira','da Zilda','Cachoeira da Zilda','Uma linda queda com um poço um pouco agitado, além de uma bela pequena praia para descansar, assim podemos descrever esse lugar.Quer descansar e ainda apreciar a natureza? Conheça a cachoeira da Zilda.','4d7754584e05ff6742783c795c13fdd2.jpg','-21.553208','-44.6386336',false,false,false,true,true,'Fácil/Médio','5 a 10 minutos',true,'10km',true,'5m','5m',true,NULL,'2022-08-17 07:41:48.192','2022-08-17 07:41:48.193'),
